//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

// import "@openzeppelin/contracts/utils/Strings.sol";

// contract GameItems is ERC1155, Ownable
contract GameItems is ERC1155 {
    // uint256 public constant CHARIZARD = 0;
    // uint256 public constant IVYSAUR = 1;
    // uint256 public constant VENUSAUR = 2;
    // uint256 public constant CHARMANDER = 3;

    mapping(uint256 => string) private _uris;

    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    address contractAddress;

    mapping(uint256 => address) private _owners;

    // constructor() ERC1155("https://bafybeihul6zsmbzyrgmjth3ynkmchepyvyhcwecn2yxc57ppqgpvr35zsq.ipfs.dweb.link/{id}.json")
    constructor(address marketplaceAddress) ERC1155("") {
        // _mint(msg.sender, CHARIZARD, 100, "");
        // _mint(msg.sender, IVYSAUR, 100, "");
        // _mint(msg.sender, VENUSAUR, 100, "");
        // _mint(msg.sender, CHARMANDER, 100, "");
        contractAddress = marketplaceAddress;
    }

    ///@notice only owner modifier
    modifier onlyOwner(uint256 tokenId) {
        require(msg.sender == ownerOf(tokenId));
        _;
    }

    function ownerOf(uint256 tokenId) public view returns (address) {
        address owner = _owners[tokenId];
        require(
            owner != address(0),
            "ERC1155: owner query for nonexistent token"
        );
        return owner;
    }

    function uri(uint256 tokenId) public view override returns (string memory) {
        return (_uris[tokenId]);
    }

    function setTokenUri(uint256 tokenId, string memory URI)
        public
        onlyOwner(tokenId)
    {
        require(bytes(_uris[tokenId]).length == 0, "Cannot set uri twice");
        _uris[tokenId] = URI;
    }

    // function _mint(
    //     address to,
    //     uint256 id,
    //     uint256 amount,
    //     bytes memory data
    // )

    function createToken(string memory tokenURI, uint256 amount)
        public
        returns (uint256)
    {
        //set a new token id for the token to be minted
        _tokenIds.increment();
        uint256 newItemId = _tokenIds.current();

        _mint(msg.sender, newItemId, amount, ""); //mint the token
        _owners[newItemId] = msg.sender;
        setTokenUri(newItemId, tokenURI); //generate the URI
        setApprovalForAll(contractAddress, true); //grant transaction permission to marketplace

        //return token ID
        return newItemId;
    }

    // function setApprovalsForAll(
    //     address operator,
    //     bool approved,
    //     uint256 tokenId
    // ) public onlyOwner(tokenId) {
    //     setApprovalForAll(operator, approved);
    // }

    function burn(uint256 tokenId, uint256 amount) public onlyOwner(tokenId) {
        _burn(msg.sender, tokenId, amount);
    }
}
